import Card from '../Card/Card.js';

const Cards = (props)=>{
    return (
        <div className="containerCards">
                     {props.characters.map((c)=>(
               <Card key={c.id} character={c} onClose={props.onClose} />
            ))}          
                   
        </div>
    )
}

export default Cards;
